import React, { Component} from 'react';
import Api from './Api';
import $ from 'jquery';
import data from "../data"; 
class home extends Component{
	
	 render(){
		return (
		    <div>
				<Button handleClick={() => console.log('Clicked button One!')}>
					Click Button One!
				</Button>
				<Button type="submit" handleClick={() => console.log('Clicked button Two!')}>
				Click Button Two!
      </Button>    
	  </div>
		);
    }
}


export default home;
